import "./index.css";

const state = usestate();

let count1 = 1;

const Function = () => {
  console.log("clicked");
};

const App = () => {
  return (
    <>
      <div className="container">
        <h1 className="heading">{count1}</h1>
        <button onClick={Function} className="btn">
          oo bhai maaro mujhe
        </button>
      </div>
    </>
  );
};

export default App;
